import React, { Component } from 'react';
import './dashboard.css'
import { Container, Row, Col } from 'react-bootstrap';

export class Dahboard extends Component {
    render() {
        return (
            <div className="dashboard">
                <Container fluid>
                    <Row>
                        <Col>
                        About
                        </Col>
                    </Row>
                </Container>
                
            </div>
        );
    }
}

export default Dahboard;
